import * as styled from "./tagsListStyles";
const TagsList = ({ items, onItemSelect, selectedItem }) => {
  return (
    <styled.TagSideBar>
      <h4>Popular Tags</h4>
      <styled.TagContainer>
        {items.map((item) => (
          <styled.TagLink
            onClick={() => onItemSelect(item)}
            key={item}
            item={item}
            curritem={selectedItem}
            to="#"
          >
            {item}
          </styled.TagLink>
        ))}
      </styled.TagContainer>
    </styled.TagSideBar>
  );
};

export default TagsList;
